/></svg></div>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               | 123 | <small>0ш</small>7Б | <small>0д</small>1111011 | <code>\\\\></code> = 62                                  |\\n| Закрита дужка            | <div style=\\\"height: 14px; width: 14px; display: flex; align-items: center;\\\"><svg class=\\\"no-dark-shadow\\\" style=\\\"transform: scale(2);\\\" width=\\\"2\\\" height=\\\"7\\\" viewBox=\\\"0 0 2 7\\\" fill=\\\"none\\\" xmlns=\\\"http://www.w3.org/2000/svg\\\"><rect x=\\\"1\\\" y=\\\"1\\\" width=\\\"1\\\" height=\\\"5\\\" fill=\\\"currentColor\\\"/><rect y=\\\"6\\\" width=\\\"1\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/><rect width=\\\"1\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/></svg></div>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               | 124 | <small>0ш</small>7В | <small>0д</small>1111100 | <code>)</code> = 41                                   |\\n| Закрита фігурна дужка    | <div style=\\\"height: 14px; width: 14px; display: flex; align-items: center;\\\"><svg class=\\\"no-dark-shadow\\\" style=\\\"transform: scale(2);\\\" width=\\\"3\\\" height=\\\"7\\\" viewBox=\\\"0 0 3 7\\\" fill=\\\"none\\\" xmlns=\\\"http://www.w3.org/2000/svg\\\"><rect x=\\\"1\\\" y=\\\"1\\\" width=\\\"1\\\" height=\\\"2\\\" fill=\\\"currentColor\\\"/><rect x=\\\"1\\\" y=\\\"4\\\" width=\\\"1\\\" height=\\\"2\\\" fill=\\\"currentColor\\\"/><rect width=\\\"1\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/><rect x=\\\"2\\\" y=\\\"3\\\" width=\\\"1\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/><rect y=\\\"6\\\" width=\\\"1\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/></svg></div>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       | 125 | <small>0ш</small>7Г | <small>0д</small>1111101 | <code>}</code> = 125                                  |\\n| Закрита квадратна дужка  | <div style=\\\"height: 14px; width: 14px; display: flex; align-items: center;\\\"><svg class=\\\"no-dark-shadow\\\" style=\\\"transform: scale(2);\\\" width=\\\"2\\\" height=\\\"7\\\" viewBox=\\\"0 0 2 7\\\" fill=\\\"none\\\" xmlns=\\\"http://www.w3.org/2000/svg\\\"><rect x=\\\"1\\\" y=\\\"1\\\" width=\\\"1\\\" height=\\\"5\\\" fill=\\\"currentColor\\\"/><rect width=\\\"2\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/><rect y=\\\"6\\\" width=\\\"2\\\" height=\\\"1\\\" fill=\\\"currentColor\\\"/></svg></div>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               | 126 | <small>0ш</small>7Д | <small>0д</small>1111110 | <code>]</code> = 93                                   |\\n| Пропуск                  |                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         | 127 | <small>0ш</small>7Е | <small>0д</small>1111111 | 32                                                    |\",\"path\":\"КД-0.html\"},{\"title\":\"Я спалахну | Документи КДБ\",\"content\":\"# Я спалахну\\n\\nКолись я думав - ти усе. Тепер я знаю, що ніщо. <br>\\nЯ спалахну вже зовсім скоро. Я стану темною ніщо. <br>\\nЙ шляхи утворяться із мене. І стану я усім. <br>\\nБо все ніщо є, й ніщо є всім.\\n\",\"path\":\"я-спалахну.html\"},{\"title\":\"Сад Світів | Документи КДБ\",\"content\":\"# Сад Світів\\n\\nРосте Дерево, а на Дереві Плід - Новий Світ.<br>\\nКвітне, іде Весна.<br>\\nВертиться, гнеться; затрусилась мокра Земля - вкорінилося Дерево до кінця.<br>\\nУпав Плід, а у ньому Свідомість-Зерня; прийняла Земля.<br>\\nТече Річка Життя.<br>\\nПрийшла Пора, омилась Земля.<br>\\nРосте нове Дерево, а воно із Знання.\\n\",\"path\":\"сад-світів.html\"},{\"title\":\"ІД | Документи КДБ\",\"content\":\"# Ідея Д\\n\\nДіяч Здійснює.\\n\",\"path\":\"ІД.html\"},{\"title\":\"ІБ | Документи КДБ\",\"content\":\"# Ідея Б\\n\\nСлово через Діло стає Тілом.\\n\",\"path\":\"ІБ.html\"},{\"title\":\"ІМ | Документи КДБ\",\"content\":\"# Ідея М\\n\\nПідмета мета Предмета.\\n\",\"path\":\"ІМ.html\"},{\"title\":\"ІМ+ | Документи КДБ\",\"content\":\"# Ідея М+\\n\\nСубʼєкт це Обʼєкт.\\n\",\"path\":\"ІМ+.html\"},{\"title\":\"ІЯ | Документи КДБ\",\"content\":\"# Ідея Я\\n\\nЯ сам себе створив.\\n\",\"path\":\"ІЯ.html\"},{\"title\":\"ІЄ | Документи КДБ\",\"content\":\"# Ідея Є\\n\\nЄ є.\\n\",\"path\":\"ІЄ.html\"},{\"title\":\"Київський порядок | Документи КДБ\",\"content\":\"# Київський порядок\\n\\nСерце! Серце! Ану стій! Ти куда мою кров діваєш!!! — прокричав мозок. <br>\\nНе твого ума діло. Та й ти сам нею розкидуєш наліво направо — пробурмотіло серце. <br>\\nМозку сильно несподобалась така неповага до себе, але що ж він може зробити. Це ж правда, мозок і сам кров кудась розпилює\\nпостійно. <br>\\nМозок промовчав. <br>\\nІ тут органи почали скаржитись: <br>\\nАх ви, ах ви, зрадники, кров нашу куди діваєте, ми ж помремо?!?! <br>\\nА ви сидіть там тихо, і не рипайтесь, бо взагалі нічого не отримаєте. Ви ж кров теж виводите кудась, не вам судити. —\\nнаказали серце й мозок. <br>\\nІ правда: частина крові, що має йти на роботу шлунка, постійно кудись дівається. І штука в тому, що шлунок її\\nотримує. <br>\\nВиявляється, шлунок її зливає, щоб менше працювати. <br>\\nЯк? Запитаєте ви, а отак.\\n\",\"path\":\"київський-порядок.html\"},{\"title\":\"Цар землі | Документи КДБ\",\"content\":\"# Цар землі\\n\\nЯкий же я великий! <br>\\nУбивши всіх <br>\\nГордито лестив сам собі <br>\\nВеликий цар землі <br>\\n<br>\\nА як помер <br>\\nЛиш пляма гною й трохи пороху <br>\\nЗалишились від нього <br>\\nНа землі <br>\\n\",\"path\":\"цар-землі.html\"},{\"title\":\"Походження слова \\\"істина\\\" | Документи КДБ\",\"content\":\"# Походження слова \\\"істина\\\"\\n\\nВідомо, що від руського \\\"есть\\\" чи \\\"исть\\\". Але його, ймовірно, взяли хтось з наших з латинського \\\"est\\\" або з грецького відповідника, які означають те саме, що і сучасні англійське \\\"is\\\" чи німецьке \\\"ist\\\" чи французьке \\\"est\\\" чи іспанське \\\"es\\\" чи італійське \\\"è\\\" (а також інші).\\n\\n\\\"істина\\\" = \\\"те, що є\\\"\\n\",\"path\":\"походження-слова-істина.html\"},{\"title\":\"Походження слова \\\"ітак\\\" | Документи КДБ\",\"content\":\"# Походження слова \\\"ітак\\\" (рос. \\\"итак\\\")\\n\\nВід латинського \\\"itaque\\\"...?\\n\",\"path\":\"походження-слова-ітак.html\"},{\"title\":\"Своєю Дорогою | Документи КДБ\",\"content\":\"# Своєю Дорогою\\n\\nІду, і бачу як багато доріг зійшлись в одну.\\nЗупинились мандрівники та й переглядаються.\\nДивиться Европа на обідрані Народи і бачить в них себе.\\nДивляться обідрані Народи на Америку і бачать в ній себе.\\nДивиться Америка на Росію і бачить на її місці себе.\\nДивиться Росія поперед себе і бачить прірву.\\nА позаду сидить Чайна і сміється з них.\\n\\nЯ махнув їм рукою та й пішов далі.\\n\",\"path\":\"своєю-дорогою.html\"},{\"title\":\"Теорія Української Мови | Документи КДБ\",\"content\":\"# (Нова) Теорія Української Мови\\n\\n> Чернетка\\n\\n## Слова\\n\\nІмена, Назви та Діячі починаються з великої букви.\\n\\nРешта слів починаються з маленької букви.\\n\\n## Буквальні\\n\\nБуквальні записуються між дволапок.\\n\\nПриклад: \\\"Слово \\\"яблуко\\\" складається із шести букв.\\\".\\n\\n## Взаємодія\\n\\n_**Діяч Здійснює.**_\\n\\nПриклад - \\\"Я люблю тебе.\\\":\\n\\n- \\\"Я\\\" - Здійснювач (Діяч)\\n- \\\"люблю тебе\\\" - Здійснюване\\n- \\\"люблю\\\" - Дія\\n- \\\"тебе\\\" - Задіяне (Дійсне)\\n\\n## Приклади\\n\\nДопустимим у фантазіях та розмові є: \\\"Скільки букв у слові \\\"яблуко\\\"?\\\".\\n\\nДопустимим у фантазіях та розмові є: \\\"Скільки букв є у слові \\\"яблуко\\\"?\\\".\\n\\nПравильним є: \\\"Скільки букв складають слово \\\"яблуко\\\"?\\\".\\n\\nПравильним є: \\\"Слово \\\"яблуко\\\" складається зі скількох букв?\\\".\\n\",\"path\":\"теорія-української-мови.html\"},{\"title\":\"Чому ніщо це все? | Документи КДБ\",\"content\":\"# Чому ніщо це все?\\n\\n1. З чого все складається?\\n2. Якщо між двома предметами на картинці нижче нічого нема, то як виглядатиме картинка насправді?\\n   <img width=\\\"100%\\\" src=\\\"../ресурси/блоки.svg\\\" alt=\\\"\\\">\\n\",\"path\":\"чому-ніщо-це-все.html\"}]");
